import React, { useEffect, useState } from "react";
import Financial from "../controllers/financial/Financial";

const Networth = () => {
  return (
    <div className="networth-page-container">
      <div className="home-dash">
        <div className="header-card">
          {/* {userData && (
            <p className="title">
              {/* Welcome {userData.fname || userData.username} 
            </p>
          )} */}
          <div className="tooltip">
            <i
              className="btn btn-primary fa-solid fa-plus"
              id="new-pnl-btn"
              //   onClick={handleOpenModal}
            ></i>
            <span className="tooltiptext">New P/L</span>
          </div>
        </div>
      </div>

      <hr />

      <div className="networth-section"></div>

      <div className="financial-section">
        <Financial />
      </div>
    </div>
  );
};

export default Networth;
